import React from "react";
import {Button} from "antd"
function Index(){
    return (
        <div className="wrap">
            <h1>不积硅步无以至千里,不积小流无以成江海</h1>
            <p>你好!我叫秦明杰</p>
            <Button>关于我</Button>
            <Button>作品</Button>
        </div>
    )
}

export default Index;
